import React from 'react';
import Paper from "@material-ui/core/Paper";


const Question = props => {

    const q = props.getit(props.id);

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{props.id}</p>
            <p>{q.titlte}</p>
        </Paper>
    )
}

export default Question;
